package com.citizant.fraudshield.util;

import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.ByteArrayOutputStream;
import java.io.File;
import java.io.IOException;

import javax.imageio.ImageIO;

import sun.misc.BASE64Decoder;
import sun.misc.BASE64Encoder;

public class ImageUtil {
	String s1 = "data:image/png;base64,";
	static String s = "";
	
	public static void main(String[] args) {
		try{ 
			BASE64Decoder bd = new BASE64Decoder();
			byte[] imgBytes = bd.decodeBuffer(s);
			
			BufferedImage bi = ImageIO.read(new ByteArrayInputStream(imgBytes));
			
			ImageIO.write(bi, "png", new File("c:/temp/yourImage0339.png"));
		}catch(Exception e){
			e.printStackTrace();
		}
	}
	
	public static BufferedImage decodeImage (String encoded) {
		BASE64Decoder bd = new BASE64Decoder();
		try {
			byte[] imageInByte = bd.decodeBuffer(encoded);
			BufferedImage image = ImageIO.read(new ByteArrayInputStream(imageInByte));			
			return image;
		} catch (IOException e) {
			
			e.printStackTrace();
		}
		return null;
	}
	
	public static String encodeImage (BufferedImage image) {
		
		try {
			BASE64Encoder ecoder = new BASE64Encoder();
			ByteArrayOutputStream baos = new ByteArrayOutputStream();
			ImageIO.write( image, "png", baos );
			baos.flush();
			byte[] imageInByte = baos.toByteArray();
			return ecoder.encode(imageInByte);		
		}catch(Exception e){
			return "";
		}
	
	}
}
